Dkbz3IpREAMCIIAQAAAAAAYEQQAgAAAAAAwIggBAAA\nAAAAgBFBCAAAAAAAACOCEAAAAAAAAEYEIQAAAAAAAIwIQgAAAAAAABgRhAAAAAAAADAiCAEA\nAAAAAGBEEAIAAAAAAMCIIAQAAAAAAIARQQgAAAAAAAAjghAAAAAAAABGBCEAAAAAAACMCEIA\nAAAAAAAYEYQAAAAAAAAwIggBAAAAAABgRBACAAAAAADAiCAEAAAAAACAEUEIAAAAAAAAI4IQ\nAAAAAAAARgQhAAAAAAAAjAhCAAAAAAAAGBGEAAAAAAAAMCIIAQAAAAAAYEQQAgAAAAAAwIgg\nBAAAAAAAgBFBCAAAAAAAACOCEAAAAAAAAEYCVdaW5bp/I5gAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":1200,"height":420}}}]},{"cell_type":"markdown","source":"There are so many outliers in our dataset, that it is impossible for us to fully visualise the boxplot image. This is not a surprise since the housing market has such a large range prices. Depending on the house size and/or location, price may vary. I have decided to slightly change the graph to have a better view of the data","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\n# Calculate the range of the y-axis to include more data\ny_min <- quantile(df$price, 0.05)  # Set lower limit to the 5th percentile\ny_max <- quantile(df$price, 0.95)  # Set upper limit to the 95th percentile\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = price)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Price\", title = \"Interquartile Range Plot of price outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(y_min, y_max) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )\n","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:00:57.363881Z","iopub.execute_input":"2024-03-11T01:00:57.365446Z","iopub.status.idle":"2024-03-11T01:01:02.461290Z"},"trusted":true},"execution_coun