ata":{"image/png":{"width":1200,"height":420}}}]},{"cell_type":"markdown","source":"Just like the price variable, the number of bedrooms in a house seems to contain many outliers. The initial assumption is that those outliers are related to the most luxurious houses presented in the dataset, containing 8 TP 20+ bedrooms per house. It is equally interesting to notice that some of the houses don't contain any bedrooms. While, the average house has 3 bedrooms, houses having up to 7 bedrooms are considered within normal range.","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = bath)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Bath\", title = \"Interquartile Range Plot of Bath outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(0, 20) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:01:05.557966Z","iopub.execute_input":"2024-03-11T01:01:05.559870Z","iopub.status.idle":"2024-03-11T01:01:08.406911Z"},"trusted":true},"execution_count":18,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 535 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4AU1eEH8LnjGr1KBxUFCaJiRyMqoogtdrFHxd5jVGJNbIli/2mMvSJ2UTRi\nQ7AlGnsDVESU3usd1/f3x8GC3N1e2yvwPp+/3u68mX0zb9/OMV/eTEosFosAAAAAAACAMKTW\ndwMAAAAAAACAuiMgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAA