cce/RAJeua2ZVS+ofLrhrZ678d984DC/2rAAAA8HsQCAEA\nAIK68/KL7/zdz7OsMjC47eHH/OVFn7lop55qStVv/Pybp598zjcuO++LXS/Z/4CDr7zn1wet\nuupVbxj68Kmnv/0dfzLQXd3mwE8cuf8vv/fxD/5iwccEQgAAgA6S5d4OBgAAAAAAAMLwGYQA\nAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACB\nCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAA\nAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgA\nAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCI\nQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAA\nABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEIhAAA\nAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAAAIEI\nhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAAAAAA\nAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhACAAA\nAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAAEIhA\nCAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAAAAAA\nEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiEAAAA\nAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAAgQiE\nAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAAAAAA\ngQiEAAAAAAAAEIhACAAAAAAAAIEIhAAAAAAAABCIQAgAAAAAAACBCIQAAAAAAAAQiEAIAAAA\nAAAAgQiEAAAAAAAAEMj/B5mg0qFBjodZAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":1200,"height":420}}}]},{"cell_type":"markdown","source":"It seems that the number of bathrooms in houses follow the same schema as the number of bedrooms. Althought, we have many outliers highlighting that some of those houses have 7 to 20+ bathrooms, and that some of those house have no bathrooms. This vvariable's data differ in the average number of bathrooms with a mean of 2 bathrooms per house and a uper ranger of 6 bathrooms. ","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\ny_min <- quantile(df$acre_lot, 0.10)\ny_max <- quantile(df$acre_lot, 0.90)\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = acre_lot)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Acre Lot\", title = \"Interquartile Range Plot of Acre Lot outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(y_min, y_max) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:01:08.408871Z","iopub.execute_input":"2024-03-11T01:01:08.409902Z","iopub.status.idle":"2024-03-11T01:01:18.058338Z"},"trusted":true},"execution_count":19,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 246063 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ5xVxcEH4LN96R2kiJViF6xRsQTBHkssUdQoxFijRDHE3o01GqO+diNBo4nY\no6IiiCV2RRFQEVGq9LYsW+/7YXfvrsvu3V5gnufT7D1z5865M+cefufPmZMUi8UiAAAAAAAA\nIAzJTd0BAAAAAAAAoPEICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAI\nCAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAA\nAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIg\nBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAA\nACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQ\nAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAA\ngIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIA\nAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAA\nAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEA\nAAAAACAgAkI