s starting at a Acre lot size of 0.8 and above. With a range between 0 and 3 acres, and an average of 0.175.","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\ny_min <- quantile(df$house_size, 0.02)\ny_max <- quantile(df$house_size, 0.98)\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = house_size)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"house_size\", title = \"Interquartile Range Plot of House Size outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(y_min, y_max) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:01:18.061633Z","iopub.execute_input":"2024-03-11T01:01:18.063501Z","iopub.status.idle":"2024-03-11T01:01:20.557309Z"},"trusted":true},"execution_count":20,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 50002 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4AU1eEH8LkKR2+CVLEBFlQQlaiIiCJq7BoLYhRi16ixxRq7xhJNLLEXfmqw\nK7aAIogaNfYSQEUU6b0e129/f9zd3nnc7bW9vcX5fP56d/N29s28ebOw33tvUiKRSAAAAAAA\nAACEQ2pTNwAAAAAAAABIHAEhAAAAAAAAhIiAEAAAAAAAAEJEQAgAAAAAAAAhIiAEAAAAAACA\nEBEQAgAAAAAAQIgICAEAAAAAACBEBIQAAAAAAAAQIgJCAAAAAAAACBEBIQAAAAAAAISIgBAA\nAAAAAABCREAIAAAAAAAAISIgBAAAAAAAgBAREAIAAAAAAECICAgBAAAAAAAgRASEAAAAAAAA\nECICQgAAAAAAAAgRASEAAAAAAACEiIAQAAAAAAAAQkRACAAAAAAAACEiIAQAAAAAAIAQERAC\nAAAAAABAiAgIAQAAAAAAIEQEhAAAAAAAABAiAkIAAAAAAAAIEQEhAAAAAAAAhIiAEAAAAAAA\nAEJEQAgAAAAAAAA