 there regular house size in square feets ranges between 0 - 2,000 sq feet, and an upper interquartile range going up to just a little above 5,100 sqr feet. With the average house size at an aproximated 1,250 sqr feet. Following the same pattern that all of the previous variables, the house size also includes a considerable amount of outliers.","metadata":{}},{"cell_type":"markdown","source":"After looking at all of the outliers present in our dataset,  it is clear that there are many luxurious (out of the average range) houses present in the market. For the sake of our model analysis, we will be focussing in the \"normal\" average houses and exclude any of the said luxurious and out of the average house. ","metadata":{}},{"cell_type":"markdown","source":"To favor our multi linear regreession model and the creation of our House calculator, I have decided to focus on a certain range of our dataset to push for more accurate results. we will be taking away all of the outliers, which represent luxurious and/or out of the common houses. \nTo take away most of the outliers we will be using the domain knowledge and visual inspection of the upper range of our box plot previously executed.","metadata":{}},{"cell_type":"code","source":"# Determine threshold for outlier detection for each variable\nthresholds <- list(\n  bed = c(lower_bound = 1, upper_bound = 7),  # Example thresholds, adjust as needed\n  bath = c(lower_bound = 1, upper_bound = 6),  \n  acre_lot = c(lower_bound = 0, upper_bound = 0.75),  \n  house_size = c(lower_bound = 0, upper_bound = 5000),  \n  price = c(lower_bound = 0, upper_bound = 1250000)  \n)\n\n# Filter out outliers for each variable\ndf_filtered <- df\nfor (variable in names(thresholds)) {\n  lower_bound <- thresholds[[variable]][\"lower_bound\"]\n  upper_bound <- thresholds[[variable]][\"upper_bound\"]\n  df_filtered <- df_filtered[df_filtered[[variable]] >= lower_bound & df_filtered[[variable]] <= upper_bound, ]\n}\n","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:17:30.922135Z","iopub.execute_input":"2024-03-11T01:17:30.923708Z","iopub.status.idle":"2024-03-11T01:17:32.198316Z"},"trusted":true},"execution_count":42,"outputs":[]},{"cell_type":"markdown","source":"In this project I took the choice to proceed with the boxplots first, as a way to clean up the present outliers before proceeding with additional data exploration using further visualizations for the sake of having less noise.","metadata":{}},{"cell_type":"code","source":"# chack new df summary\nsummary(df_filtered)","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:28:12.267705Z","iopub.execute_input":"2024-03-11T01:28:12.269070Z","iopub.status.idle":"2024-03-11T01:28:12.972610Z"},"trusted":true},"execution_count":43,"outputs":[{"output_type":"display_data","data":{"text/plain":"    status               bed             bath          acre_lot     \n Length:1535357     Min.   :1.000   Min.   :1.000   Min.   :0.0000  \n Class :character   1st Qu.:2.000   1st Qu.:1.000   1st Qu.:0.0000  \n Mode  :character   Median :3.000   Median :2.000   Median :0.1000  \n                    Mean   :3.032   Mean   :2.168   Mean   :0.1504  \n                    3rd Qu.:4.000   3rd Qu.:3.000   3rd Qu.:0.2300  \n                    Max.   :7.000   Max.   :6.000   Max.   :0.7500  \n     city              state              zip_code       house_size  \n Length:1535357     Length:1535357     Min.   :  601   Min.   :   0  \n Class :character   Class :character   1st Qu.: 8104   1st Qu.: 810  \n Mode  :character   Mode  :character   Median :13212   Median :1332  \n                                       Mean   :13260   Mean   :1377  \n                                       3rd Qu.:19072   3rd Qu.:1925  \n                                       Max.   :95000   Max.   :5000  \n prev_sold_date         price        \n Length:1535357     Min.   :      0  \n Class :character   1st Qu.: 199900  \n Mode  :character   Median : 350000  \n                    Mean   : 412259  \n                    3rd Qu.: 575000  \n                    Max.   :1250000  "},"metadata":{}}]},{"cell_type":"markdown","source":"After filtering out some of the data noise present in our dataframe, we can notice how the total number of rows has been reduced to 1,535,357 from the initial 2,501,666 rows. The dataset is still fairly large.\n","metadata":{}},{"cell_type":"code","source":"#Histogram of Bed count distribution\nhist_bed <- ggplot(df_filtered, aes(x = bed)) +\n  geom_histogram(fill = \"green\", color = \"white\", bins = 20) +\n  labs(title = \"Histogram of Bed Counts\",\n       x = \"Number of Beds\",\n       y = \"Count\") +\n  theme_minimal() +\n  #coord_cartesian(xlim = c(1, 7)) +\n  scale_y_continuous(labels = scales::comma)\n\nprint(hist_bed)","metadata":{"execution":{"iopub.status.busy":"2024-03-11T01:34:16.702365Z","iopub.execute_input":"2024-03-11T01:34:16.703652Z","iopub.status.idle":"2024-03-11T01:34:17.776299Z"},"trusted":true},"execution_count":51,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZzc8/3A8c/s7OyVzSWRQyRBpESSuipxRRFXqkhQrbYorTqrilJVR3+UljZK\nXS1tKaUHTVqkiiKouOu+JY4iiCR7X3P8/thIVmQ3m9js2Pk8n39lv9e8Z+b7fezxyswkcrlc\nAAAAAAAAAOJQlO8BAAAAAAAAgO4jEAIAAAAAAEBEBEIAAAAAAACIiEAIAAAAAAAAEREIAQAA\nAAAAICICIQAAAAAAAEREIAQAAAAAAICICIQAAAAAAAAQEYFwJRoXzUokEsWl67S3wZ1TRiYS\nia1+9lTrl4+dulkikZgy++3uGrCg1M+/+9DJWw6sLBk89ocr3KDmzZ8kPqYoWbrWoPUm73vE\njP8u6MJhLhzVP5FIzFrUuNItc5mamZf935d223r4kIHlqZK+aw3afPvdfzD9ugUt2S6cBwAA\nAAAAoEsU53sAQi5b98CcJ4pLR0z83PB8z5JnZ07a9+pXFg/ZYufdJozuYLOiZK8N1h+69Mt0\nU93bb71x14zf3POPP54x68Uzdxu25iddpu6tu6ZtP/WO12pCCKW9BwwZNnjxu+888Z/bn/jP\n7Zf96urbHr1l2wFl3TnPUs4rAAAAAABghbyCsIut96Wzr7766hM37t/5XdINL22//fa77Xfl\nmpuqZ8g1X/RqVapizKuP3HnN5Yd2sGFp3x1fbmPeG2/XfPDKOV/eKJupO3e/veuyuW4bOd3w\n4u7j9rzjtZqROx4266GXG6sXvPbam4vrap769w3Txq9V89q/vzDh6KbuG2e52ZxXAAAAAADA\nCgiEXWzAFnsdcsghuwwuz/cgPU8u29CSy6UqxlYUJVZ135J+G5x6